import React from 'react';

import WeeklySchedule from './WeeklySchedule.jsx';
import PacmanLoad from 'react-spinners/PacmanLoader';

import './ScheduleViewer.scss';

export default class ScheduleViewer extends React.Component {
    constructor(props) {
        super(props);

        this.courses     = props.courses;
        this.instructors = props.instructors;

        this.state = {
            schedule: null
        };
    }

    componentDidMount() {
        //console.log( this.courses );
        this.run_scheduler();
    }

    run_scheduler() {
        window.pypyjs.ready().then(function() {
            return window.pypyjs.execfile('../../main.py');
            /*return window.pypyjs.exec(
`import os
x = [0] * 3
`);*/
        }).then(function() {
            return window.pypyjs.get('x');
        }).then(function(result) {
            console.log(result);
        });
    }

    render() {
        console.log(this.state.schedule);
        return (
            <>
                { this.state.schedule ?

                    <WeeklySchedule schedule = {this.state.schedule} />

                :

                    <div className="sv-loading">
                        <PacmanLoad size='50px' color='white' />
                    </div>
                }
            </>
        );
    }
}
